window.bookSummaryJSON = "<p>In the near future, the world has seen drastic shifts. Global climate change has altered countries and continents; mega-corporations have altered society and governments; oligenetics, physics, and nanotechnology has altered humankind; and The T.A.L.O.N. Agency is a leader in all these things.&nbsp;</p> <p>Disappear into the shadows of a dark-and-dirty, street-level, borderline cyberpunk dystopian series of stories about heroes and villains, born from one corporation changing the world for the better to create a utopia.</p>"; 
